import React from "react";
import { HeaderContainer } from "../containers/header";
import HeadCon from "../containers/header";
import { HomCon } from "../component";


export default function About() {

    return (
        <>
            <HeadCon/>
            <HomCon>
                <HomCon.Title>
                About AO3
                </HomCon.Title>
                <HomCon.TextBlock>AO3, also known as Archive of Our Own, is a fan fiction website that allows users to create and share their own stories. The website is run by a team of volunteers and is supported by sponsors, who help to keep the website running and improving. The website has a wide variety of stories, including fan fiction for books, movies, TV shows and more. AO3 is a platform for creators to share their work and build communities, and for readers to discover new stories and connect with other fans.</HomCon.TextBlock>
            </HomCon>
        </>
    )
}
